import WixServiceCard from "./WixServiceCard";

import facial from "../img/facial.png";
import makeup from "../img/makeup.png";
import hair from "../img/hair.jpg";
import nails from "../img/nails.jpg";

export default function Services() {
  return (
    <section id="services" className="max-w-6xl mx-auto px-6 py-12">
      <h2 className="text-2xl font-bold text-strong mb-8">Our Services</h2>

      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">

        <WixServiceCard
          title="FACIALS"
          color="blush"
          image={facial}
        />

        <WixServiceCard
          title="MAKE UP"
          color="dark"
          image={makeup}
        />

        <WixServiceCard
          title="HAIR STYLING"
          color="nude"
          image={hair}
        />

        <WixServiceCard
          title="NAILS"
          color="blush"
          image={nails}
        />

      </div>
    </section>
  );
}
